import React, { Component } from 'react';

class Coin extends React.Component {
  render() {
    // const imagePath = './coin.png';
    return (
      <img
        className={this.props.class}
        src="../../../my-app/src/img/coin.png"
        alt=""
      />
    );
  }
}
export default Coin;
